webpackJsonp([0x81b8806e4260],{344:function(e,t){e.exports={data:{allMarkdownRemark:{totalCount:4,edges:[{node:{id:"/Users/dino/Documents/dino/jszgb.github.io/src/pages/posts/2016-04-01_Coffeejs.md absPath of file >>> MarkdownRemark",html:"<p>JavaScript and other tech professionals non-formal social meeting.</p>\n<p>Today, on April 1st 2016., another CoffeeJS Zagreb Meetup took place in Kino Europa at 9 o'clock. Again we had the same number of 5 enthusiasts as last time but this time some new faces shown up.</p>\n<p>In relaxing atmosphere of Kino Europa we were discussing about Webpack, Browserify, Enterprise software production, HTML PDF app, servers, passenger, iOS development and much more.</p>\n<p>Join us next week at the same time and <em>please give us hint for scheduling next CoffeeJS</em> (day in the week or hour) that would suit you more if you would like to join us.</p>\n<p>See you next time.</p>",frontmatter:{title:"CoffeeJS#2",date:"01.04.2016"}}},{node:{id:"/Users/dino/Documents/dino/jszgb.github.io/src/pages/posts/2016-03-10_jsZgb-24.md absPath of file >>> MarkdownRemark",html:'<p>This time we will talk about <a href="http://electron.atom.io/">Electron</a>, a tool for building cross platform desktop apps which was initially developed for <a href="https://atom.io/">Githubs atom</a> editor and <a href="https://ngrok.com/">ngrok</a>.</p>\n<h2>Introduction to Electron</h2>\n<h4>Vjekoslav Ratkajec</h4>\n<p>Electron enables you to create cross-platform desktop apps with web technologies. It is based on Chromium and uses Node.js to enable working with OS, and HTML, CSS and JavaScript for UI.</p>\n<p>For years I\'ve been working as an ActionScript developer making cross-platform apps in Adobe AIR. Few months ago I\'ve started to work with Electron. I\'m also writing my thoughts and findings on my blog Electron Rocks!</p>\n<h2>ngrok - Secure tunnels to localhost</h2>\n<h4>Mihaela Mihaljević Jakić</h4>\n<p>Save time and be more productive. Expose local servers behind NATs and firewalls to the public internet over secure tunnels.</p>',frontmatter:{title:"jsZgb",date:"10.03.2016"}}},{node:{id:"/Users/dino/Documents/dino/jszgb.github.io/src/pages/posts/2016-03-09_new-stuff.md absPath of file >>> MarkdownRemark",html:'<p>We have a new Slack channel up and running and you can sign up for it here <a href="https://jszgb-slack.herokuapp.com/">https://jszgb-slack.herokuapp.com/</a></p>\n<p>And we have made a more user friendly github repo <a href="https://github.com/jszgb/jszgb.github.io">https://github.com/jszgb/jszgb.github.io</a></p>\n<p>We think that this two changes will add a great value to our community and that they will for sure bring up the quality of our meetups.</p>',frontmatter:{title:"Some new stuff!!!",date:"09.03.2016"}}},{node:{id:"/Users/dino/Documents/dino/jszgb.github.io/src/pages/posts/2016-02-14_new-site.md absPath of file >>> MarkdownRemark",html:'<p>We have finally re-launch our site! Here you will be able to find all the stuff from our meetups\n<img src="https://media.giphy.com/media/YHvwPgwojjsFa/giphy.gif" alt="jsZgb"></p>',frontmatter:{title:"Re-launch of our site",date:"14.02.2016"}}}]}},pathContext:{}}}});
